**BUILD_UNSTAGES** BY UNREAL

So, this is my attempt at making a Build map. My goal was to make a big map, very optimized which would have a good performance on servers.
I'd also like to thank MAT4DOR, ARCscorpion and TopHATTwaffle for their kindness.

It has 9 stages (plus admin area), each very large and high rooms.

Features:
- Custom radar;

- Big space;

- Optimized (you will only load 2 rooms at the same time);

- 3DSkybox;

- Admin area;

- Lighning;

- 40+ slots

And more...!


I hope you like it, have fun!


